import kivy
kivy.require('1.0.6')
from kivy.app import App
from kivy.uix.widget import Widget
from kivy.graphics import Color, Rectangle
from kivy.core.window import Window
from kivy.clock import Clock

import numpy
import math

# graphics globals
w = 1044
h = 400
cw = w * 2
ch = h * 2
xpadding = 10
ypadding = 10
rcolor = (1, 1, 1, 1)
numrects = 50
rwidth = (cw - (xpadding * 2)) / numrects
rheight = ch - (ypadding * 2)
rheights = [0] * numrects
rectangles = [0] * numrects

class AV_Canvas(Widget):
    def __init__(self, **kwargs):
        super(AV_Canvas, self).__init__(**kwargs)
        self.size = (cw * 2, ch * 2)
        self.pos = (0, 0)
        with self.canvas.before:
            Color(0.1, 0.1, 0.1, 1)
            self.rect = Rectangle(size=self.size, pos=self.pos)
        with self.canvas:
            Color(rcolor)
            for r in range(numrects):
                rectangles[r] = Rectangle(size=(rwidth - 1, rheight - 100), pos=(xpadding + (rwidth * r), ypadding))
    def update(self, percentages):
        # draw rectangles based on fourier transform
        depth = len(percentages)
        step = math.ceil(float(depth) / float(numrects))
        moddepth = numrects * step
        if (moddepth > depth):
            percentages = numpy.append(percentages, numpy.zeros(moddepth - depth, dtype='float64'))
        i = 0
        r = 0
        while i < moddepth:
            avg = 0.0
            for j in range(step):
                avg += percentages[i + j]
            avg /= step
            rheights[r] = rheight * avg
            i += step
            r += 1
        for r in range(numrects):
            rectangles[r].size = (rwidth - 1, rheights[r])

